Unsolved History: Death of the Red Baron

War Documentary hosted by Kathleen Kern, published by Discovery Channel in 2002 - English narration


Information
------------------------------

Unsolved History: Death of the Red Baron
Unsolved History is history the way it was! Through detailed examination of archeological and forensic evidence, existing photographs, artifact examination, and carefully selected interviews from eyewitnesses and experts - events are reconstructed and historical questions are finally answered. Manfred von Richthofen, known to the world as &quot;The Red Baron,&quot; was the greatest flying ace of World War I - and still to this day revered as the most famous and skilled pilot the world has ever known. He sent scores of Allied flyers down in flames throughout the war, but he was not invincible. Richthofen was shot down over a French field on the morning of April 21, 1918, killed by a single bullet that passed clear through his heart. Who shot The Red Baron? Was it Canadian pilot Roy Brown, who had been on his tail just a minute or so before the Baron's red triplane crashed? Was it one of the Australian gunners firing at the plane skimming just a couple of hundred feet above them? Or, was it another unsung Allied hero? To this day, it's been a mystery from history. But now, with the latest techniques in ballistic analysis, microscopic forensics, computer flight simulators and high-powered laser range findings, learn the truth behind what happened on the final flight of the Kaiser's finest air warrior.

